er bis zum Widerruf erfolgten Datenverarbeitung bleibt vom Widerruf unberÃ¼hrt.</p>\r\n\r\n<p><strong>Recht auf Beschwerde bei der zustÃ¤ndigen AufsichtsbehÃ¶rde</strong></p>\r\n<p>Als Betroffener steht Ihnen im Falle eines datenschutzrechtlichen VerstoÃes ein Beschwerderecht bei der zustÃ¤ndigen AufsichtsbehÃ¶rde zu. ZustÃ¤ndige AufsichtsbehÃ¶rde bezÃ¼glich datenschutzrechtlicher Fragen ist der Landesdatenschutzbeauftragte des Bundeslandes, in dem sich der Sitz unseres Unternehmens befindet. Der folgende Link stellt eine Liste der Datenschutzbeauftragten sowie deren Kontaktdaten bereit: <a href=\"https://www.bfdi.bund.de/DE/Infothek/Anschriften_Links/anschriften_links-node.html\" target=\"_blank\">https://www.bfdi.bund.de/DE/Infothek/Anschriften_Links/anschriften_links-node.html</a>.</p>\r\n\r\n<p><strong>Recht auf DatenÃ¼bertragbarkeit</strong></p>\r\n<p>Ihnen steht das Recht zu, Daten, die wir auf Grundlage Ihrer Einwilligung oder in ErfÃ¼llung eines Vertrags automatisiert verarbeiten, an sich oder an Dritte aushÃ¤ndigen zu lassen. Die Bereitstellung erfolgt in einem maschinenlesbaren Format. Sofern Sie die direkte Ãbertragung der Daten an einen anderen Verantwortlichen verlangen, erfolgt dies nur, soweit es technisch machbar ist.</p>\r\n\r\n<p><strong>Recht auf Auskunft, Berichtigung, Sperrung, LÃ¶schung</strong></p>\r\n<p>Sie haben jederzeit im Rahmen der geltenden gesetzlichen Bestimmungen das Recht auf unentgeltliche Auskunft Ã¼ber Ihre gespeicherten personenbezogenen Daten, Herkunft der Daten, deren EmpfÃ¤nger und den Zweck der Datenverarbeitung und ggf. ein Recht auf Berichtigung, Sperrung oder LÃ¶schung dieser Daten. DiesbezÃ¼glich und auch zu weiteren Fragen zum Thema personenbezogene Daten kÃ¶nnen Sie sich jederzeit Ã¼ber die im Impressum aufgefÃ¼hrten KontaktmÃ¶glichkeiten an uns wenden.</p>\r\n\r\n<p><strong>SSL- bzw. TLS-VerschlÃ¼sselung</strong></p>\r\n<p>Aus SicherheitsgrÃ¼nden und zum Schutz der Ãbertragung vertraulicher Inhalte, die Sie an uns als Seitenbetreiber senden, nutzt unsere Website eine SSL-bzw. TLS-VerschlÃ¼sselung. Damit sind Daten, die Sie Ã¼ber diese Website Ã¼bermitteln, fÃ¼r Dritte nicht mitlesbar. Sie erkennen eine verschlÃ¼sselte Verbindung an der âhttps://â Adresszeile Ihres Browsers und am Schloss-Symbol in der Browserzeile.</p>\r\n\r\n<p><strong>Server-Log-Dateien</strong></p>\r\n<p>In Server-Log-Dateien erhebt und speichert der Provider der Website automatisch Informationen, die Ihr Browser automatisch an uns Ã¼bermittelt. Dies sind:</p>\r\n<ul>\r\n    <li>Besuchte Seite auf unserer Domain</li>\r\n    <li>Datum und Uhrzeit der Serveranfrage</li>\r\n    <li>Browsertyp und Browserversion</li>\r\n    <li>Verwendetes Betriebssystem</li>\r\n    <li>Referrer URL</li>\r\n    <li>Hostname des zugreifenden Rechners</li>\r\n    <li>IP-Adresse</li>\r\n</ul>\r\n<p>Es findet keine ZusammenfÃ¼hrung dieser Daten mit anderen Datenquellen statt. Grundlage der Datenverarbeitung bildet Art. 6 Abs. 1 lit. b DSGVO, der die Verarbeitung von Daten zur ErfÃ¼llung eines Vertrags oder vorvertraglicher MaÃnahmen gestattet.</p>\r\n            \r\n<p><strong>Kontaktformular</strong></p>\r\n<p>Per Kontaktformular Ã¼bermittelte Daten werden einschlieÃlich Ihrer Kontaktdaten gespeichert, um Ihre Anfrage bearbeiten zu kÃ¶nnen oder um fÃ¼r Anschlussfragen bereitzustehen. Eine Weitergabe dieser Daten findet ohne Ihre Einwilligung nicht statt.</p>\r\n<p>Die Verarbeitung der in das Kontaktformular eingegebenen Daten erfolgt ausschlieÃlich auf Grundlage Ihrer Einwilligung (Art. 6 Abs. 1 lit. a DSGVO). Ein Widerruf Ihrer bereits erteilten Einwilligung ist jederzeit mÃ¶glich. FÃ¼r den Widerruf genÃ¼gt eine formlose Mitteilung per E-Mail. Die RechtmÃ¤Ãigkeit der bis zum Widerruf erfolgten DatenverarbeitungsvorgÃ¤nge bleibt vom Widerruf unberÃ¼hrt.</p>\r\n<p>Ãber das Kontaktformular Ã¼bermittelte Daten verbleiben bei uns, bis Sie uns zur LÃ¶schung auffordern, Ihre Einwilligung zur Speicherung widerrufen oder keine Notwendigkeit der Datenspeicherung mehr besteht. Zwingende gesetzliche Bestimmungen - insbesondere Aufbewahrungsfristen - bleiben unberÃ¼hrt.</p>\r\n            \r\n<p><strong>Cookies</strong></p>\r\n<p>Unsere Website verwendet Cookies. Das sind kleine Textdateien, die Ihr Webbrowser auf Ihrem EndgerÃ¤t speichert. Cookies helfen uns dabei, unser Angebot nutzerfreundlicher, effektiver und sicherer zu machen. </p>\r\n<p>Einige Cookies sind âSession-Cookies.â Solche Cookies werden nach Ende Ihrer Browser-Sitzung von selbst gelÃ¶scht. Hingegen bleiben andere Cookies auf Ihrem EndgerÃ¤t bestehen, bis Sie diese selbst lÃ¶schen. Solche Cookies helfen uns, Sie bei RÃ¼ckkehr auf\r\n	unserer Website wiederzuerkennen.</p>\r\n<p>Mit einem modernen Webbrowser kÃ¶nnen Sie das Setzen von Cookies Ã¼berwachen, einschrÃ¤nken oder unterbinden. Viele Webbrowser lassen sich so konfigurieren, dass Cookies mit dem SchlieÃen des Programms von selbst gelÃ¶scht werden. Die Deaktivierung von Cookies\r\n	kann eine eingeschrÃ¤nkte FunktionalitÃ¤t unserer Website zur Folge haben.</p>\r\n<p>Das Setzen von Cookies, die zur AusÃ¼bung elektronischer KommunikationsvorgÃ¤nge oder der Bereitstellung bestimmter, von Ihnen erwÃ¼nschter Funktionen (z.B. Warenkorb) notwendig sind, erfolgt auf Grundlage von Art. 6 Abs. 1 lit. f DSGVO. Als Betreiber dieser\r\n	Website haben wir ein berechtigtes Interesse an der Speicherung von Cookies zur technisch fehlerfreien und reibungslosen Bereitstellung unserer Dienste. Sofern die Setzung anderer Cookies (z.B. fÃ¼r Analyse-Funktionen) erfolgt, werden diese in dieser\r\n	DatenschutzerklÃ¤rung separat behandelt.</p>\r\n            \r\n<p><strong>Matomo (ehemals Piwik)</strong></p>\r\n<p>Unsere Website verwendet den Webanalysedienst Matomo. Matomo ist eine Open Source LÃ¶sung.</p>\r\n<p>Matomo verwendet \"Cookies.\" Das sind kleine Textdateien, die Ihr Webbrowser auf Ihrem EndgerÃ¤t speichert und die eine Analyse der Website-Benutzung ermÃ¶glichen. Mittels Cookie erzeugte Informationen Ã¼ber die Benutzung unserer Website werden\r\n	auf unserem Server gespeichert. Vor der Speicherung erfolgt eine Anonymisierung Ihrer IP-Adresse.</p>\r\n<p>Cookies von Matomo verbleiben auf Ihrem EndgerÃ¤t, bis Sie eine LÃ¶schung vornehmen.</p>\r\n<p>Das Setzen von Matomo-Cookies erfolgt auf Grundlage von Art. 6 Abs. 1 lit. f DSGVO. Als Betreiber dieser Website haben wir ein berechtigtes Interesse an der anonymisierten Analyse des Nutzerverhaltens, um sowohl unser Webangebot und ggf. auch Werbung\r\n	zu optimieren.</p>\r\n<p>Es erfolgt keine Weitergabe der im Matomo-Cookie gespeicherten Informationen Ã¼ber die Benutzung dieser Website. Das Setzen von Cookies durch Ihren Webbrowser ist verhinderbar. Einige Funktionen unserer Website kÃ¶nnten dadurch jedoch eingeschrÃ¤nkt werden. </p>\r\n<p>Sie kÃ¶nnen hier die Speicherung und Nutzung Ihrer Daten deaktivieren. Ihr Browser setzt ein Opt-Out-Cookie, welches die Speicherung von Matomo Nutzungsdaten unterbindet. Wenn Sie Ihre Cookies lÃ¶schen, wird auch das Matomo Opt-Out-Cookie entfernt. Bei\r\n	einem erneuten Besuch unserer Website ist das Opt-Out-Cookie zur Unterbindung der Speicherung und Nutzung Ihrer Daten erneut zu setzen.</p>\r\n<p>[Hier Matomo iframe-Code einfÃ¼gen]</p>\r\n            \r\n<p><strong>Google Web Fonts</strong></p>\r\n<p>Unsere Website verwendet Web Fonts von Google. Anbieter ist die Google Inc., 1600 Amphitheatre Parkway, Mountain View, CA 94043, USA.</p>\r\n<p>Durch den Einsatz dieser Web Fonts wird es mÃ¶glich Ihnen die von uns gewÃ¼nschte Darstellung unserer Website zu prÃ¤sentieren, unabhÃ¤ngig davon welche Schriften Ihnen lokal zur VerfÃ¼gung stehen. Dies erfolgt Ã¼ber den Abruf der Google Web Fonts von einem Server von Google in den USA und der damit verbundenen Weitergabe Ihre Daten an Google. Dabei handelt es sich um Ihre IP-Adresse und welche Seite Sie bei uns besucht haben. Der Einsatz von Google Web Fonts erfolgt auf Grundlage von Art. 6 Abs. 1 lit. f DSGVO. Als Betreiber dieser Website haben wir ein berechtigtes Interesse an der optimalen Darstellung und Ãbertragung unseres Webauftritts.</p>\r\n<p>Das Unternehmen Google ist fÃ¼r das us-europÃ¤ische DatenschutzÃ¼bereinkommen \"Privacy Shield\" zertifiziert. Dieses DatenschutzÃ¼bereinkommen soll die Einhaltung des in der EU geltenden Datenschutzniveaus gewÃ¤hrleisten.</p>\r\n<p>Einzelheiten Ã¼ber Google Web Fonts finden Sie unter: <a href=\"https://www.google.com/fonts#AboutPlace:about\">https://www.google.com/fonts#AboutPlace:about</a> und weitere Informationen in den Datenschutzbestimmungen von Google: <a href=\"https://policies.google.com/privacy/partners?hl=de\">https://policies.google.com/privacy/partners?hl=de</a></p>\r\n            <p><small>Quelle: Datenschutz-Konfigurator von <a href=\"http://www.mein-datenschutzbeauftragter.de\" target=\"_blank\">mein-datenschutzbeauftragter.de</a></small></p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'','',0,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>',0),(35,'',16,1579891240,1579891240,1,0,0,0,0,'',256,0,0,0,0,NULL,0,'',0,0,'',0,0,0,0,0,0,'list','','',NULL,0,0,0,0,0,0,0,2,0,0,0,'default',0,0,0,'','',NULL,'16',0,'','',0,'0','wdlassortments_assortment',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'',''